import React from "react";
import Mix from "../Mix";

const MixContainer = ({ stations }) => (
  <section>
    <h1>h1</h1>
    {stations.map((mixes) => (
        <p>{mixes.name}</p>
    ))}
  </section>
);

export default MixContainer;
